description:
Double Jumpers, the complete mini-series by Dave Dwonch and Bill Blankenship. Published by Action Lab. All credit to the original scanners.

Plot blurb from comixology - &quot;After Jason and his team of programmers get stuck in their virtual reality game, Dungeon Lords, they must find a way back to the real world. Unbeknownst to them, the fantasy characters they inhabit have taken control of their bodies--and now wizards and warriors run free in Las Vegas!&quot;

Enjoy and please seed! :-)
